    %% MAIN FUNCTIONS
    % ==================================================================================================================================================
    methods (Static)
        function [cmap, found] = get(map_name, n_color, flag_smooth)
            % Getter function, get any of the colormap stored / implemented 
            % into this class.
            % To show all the implemented colormaps use any of the "show" methods
            %
            % INPUT
            %   map_name    name of the colormap function
            %   n_color     number of color requested
            %               could be empty, in this case the default number of color is provided
            %   flag_smooth if it is true (default choice) smooths the colormap in out,
            %               requires goGPS splinerMat function
            %
            % SYNTAX
            %   [cmap, found] = Colormap.get(map_name, <n_color>, <flag_smooth = true>)
            %
            if nargin < 3 || isempty(flag_smooth)
                flag_smooth = false;
            end
                        
            % Set default to parula
            tmp = strfind(Colormap.MPL_MAPS, map_name); 
            id = find((~cellfun(@isempty, tmp)) & (cellfun(@length, Colormap.MPL_MAPS) == numel(map_name)));
            found = ~isempty(id);
            if found
                source_cmap = Colormap.MPL_CMAP(:, :, id);
                
                % Do not smooth flag or prism colormaps
                if strcmp(map_name, 'flag') || strcmp(map_name, 'prism')
                    id_ko = [false; (diff(int64(uint32(source_cmap(:,1)) * 2^16 + uint32(source_cmap(:,2)) * 2^8 + uint32(source_cmap(:,3)))) == 0)];
                    source_cmap(id_ko, :) = [];
                    flag_smooth = false;
                end
                
                % Find qualitative maps that needs to be interpolated with nearest neighbour
                tmp = strfind(Colormap.QUALITATIVE, map_name);
                is_qualitative = any(~cellfun(@isempty, tmp));
                if is_qualitative
                    method = 'nearest';
                    % Get only unique colors present in the cmaps
                    [~, id_unique] = unique(uint32(source_cmap(:,1)) * 2^16 + uint32(source_cmap(:,2)) * 2^8 + uint32(source_cmap(:,3)));
                    source_cmap = double(source_cmap(sort(id_unique), :)) / 256;
                else
                    source_cmap = double(source_cmap) / 256;
                    method = 'linear';
                    if flag_smooth
                        source_cmap = Colormap.smoothMap(source_cmap);
                    end
                end
                source_n_col = size(source_cmap,1);
                
                if nargin < 1 || isempty(n_color)
                    cmap = source_cmap;
                else
                    cmap = zeros(n_color, 3);
                    c_pos = floor(((0 : (n_color - 1)) / (n_color)) * (source_n_col)) + 1;
                    for c = 1 : 3
                        cmap(:, c) = interp1(1 : source_n_col, source_cmap(:, c), c_pos, method);
                    end
                end
            else
                switch map_name
                    case 'gat'
                        if nargin == 1 || isempty(n_color)
                            cmap = gat(1024, false);
                        else
                            cmap = gat(n_color, false);
                        end
                        found = true;
                    case 'gat2'
                        if nargin == 1 || isempty(n_color)
                            cmap = gat2();
                        else
                            cmap = gat2(n_color);
                        end
                        found = true;
                    case 'parula'
                        if nargin == 1 || isempty(n_color)
                            cmap = parula();
                        else
                            cmap = parula(n_color);
                        end
                        found = true;
                end
            end
            
            if ~found
                if nargin == 1 || isempty(n_color)
                    cmap = parula();
                else
                    cmap = parula(n_color);
                end
                fprintf('Colormap %s not found\n', map_name);            
            end
        end
                
        function smooth_cmap = smoothMap(cmap)
            % Given a colormap smooth it with splines in the RGB color space
            % This function can be triggered automatically by the get function
            %
            % The function can be useful since the original colormaps were 
            % imported from image files
            %
            % SYNTAX
            %   smooth_cmap = Colormap.smoothMap(cmap)
            %
            % SEE ALSO
            %   splinerMat
            %
            cmap = double(cmap);
            try
                smooth_cmap = cmap;
                for c = 1 : 3
                    smooth_cmap(:,c) = splinerMat([], cmap(:,c), size(cmap,1) / 30);
                end
            catch
                % The only reason this exception could be triggered is that
                % splinerMat is not in matlab path -> no smoothing
            end
        end
    end
    
    %% CUSTOM MAPS
    % ==================================================================================================================================================
    methods (Static)        
        function cmap = gat(n_color, flag_zero_center, flag_use_white)
            if nargin < 1
                n_color = 255;
            end
            if nargin < 2
                flag_zero_center = 1;
            end
            if nargin < 3
                flag_use_white  = 1;
            end
            
            
            clim = caxis();
            if (clim(1)>0 || clim(2)<0)
                flag_zero_center = 0;
            end
            if flag_zero_center
                center = round(clim(2)*n_color/(clim(2)-clim(1)));
                N = 2*center;
            else
                N = n_color;
                center = round(n_color/2);
            end
            
            if n_color == 0
                cmap = [];
                return
            end
            
            try
                L = ones(n_color,1)*100;
                a = ones(n_color,1)*0;
                b = ones(n_color,1)*0;
                
                % RED     100  128  128
                % VIOLET  100  128 -128
                % GREEN     x -128  128
                % BLUE      x -128 -128
                
                % BLACK => RED => GREEN =>  BLUE => VIOLET
                
                % BLACK to RED
                n_val = floor(N*5/32);
                Lab1 = [20 20 10];
                Lab2 = [40 100 128];
                step = 1/(n_val-1);
                L(1:n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','linear');
                a(1:n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                b(1:n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                s = n_val;
                
                % RED to YELLOW
                n_val = floor(N*6/32);
                Lab1 = [40 100 120];
                Lab2 = [100 -20 128];
                step = 1/(n_val);
                L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','pchip');
                a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                s = s+n_val;
                
                % YELLOW to GREEN
                n_val = floor(N*3/32);
                Lab1 = [100 0 128];
                Lab2 = [75 -80 80];
                step = 1/(n_val);
                L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','pchip');
                a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                s = s+n_val;
                
                % GREEN to useWhite
                if (flag_use_white)
                    % nVal = floor(N * 2 / 32);
                    Lab1 = [75 -80 80];
                    Lab2 = [100 0 0];
                    step = 1/(center-s);
                    L(s:center) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','linear');
                    a(s:center) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                    b(s:center) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                    s = center;
                end
                
                % HALF BAR ------- ------- ------- ------- ------- ------- ------- -------
                
                % GREEN to BLUE
                if (~flag_use_white)
                    n_val = floor(N*3/32);
                    Lab1 = [75 -80 80];
                    Lab2 = [100 -80  0];
                    step = 1/(n_val);
                    L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','linear');
                    a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                    b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                    s = s+n_val;
                end
                
                if flag_zero_center
                    N = 2*(n_color-center);
                end
                
                if N > 0
                    if (~flag_use_white)
                        n_val = floor(N*2/32);
                        Lab1 = [100 -80 0];
                        Lab2 = [80 40 -128];
                        step = 1/(n_val);
                        L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','linear');
                        a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                        b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                        s = s+n_val;
                    end
                    % HALF BAR ------- ------- ------- ------- ------- ------- ------- -------
                    
                    if (flag_use_white)
                        % useWhite to BLUE
                        n_val = floor(N*2/32);
                        Lab1 = [100 0 0];
                        Lab2 = [80 40 -128];
                        step = 1/(n_val);
                        L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','linear');
                        a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                        b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                        s = s+n_val;
                    end
                    
                    % BLUE to PINK
                    n_val = floor(N*3/32);
                    Lab1 = [80 40 -128];
                    Lab2 = [50 -80 -80];
                    step = 1/(n_val);
                    L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','linear');
                    a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                    b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                    s = s+n_val;
                    
                    % BLUE to VIOLET
                    n_val = floor(N*4/32);
                    Lab1 = [50 -80 -80];
                    Lab2 = [0 100 -128];
                    step = 1/(n_val);
                    L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','linear');
                    a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                    b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                    s = s+n_val;
                    
                    % BLUE to VIOLET
                    n_val = floor(N*4/32);
                    Lab1 = [0  100 -128];
                    Lab2 = [40 128 -128];
                    step = 1/(n_val);
                    L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','linear');
                    a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                    b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                    s = s+n_val;
                    
                    % BLUE to VIOLET
                    %nVal = floor(N*4/32);
                    Lab1 = [40 128 -128];
                    Lab2 = [25 10 -20];
                    step = 1/(n_color-s);
                    L(s:end) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','linear');
                    a(s:end) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                    b(s:end) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                end
                
                %L = [[0:100/(nColors/2-1):100]' ; flipud([0:100/(nColors/2-1):100]')];
                %L = flipud([0:100/(nColors-1):100]');
                cmap = flipud(Colormap.lab2RGB(L, a, b )./255);
            catch
                cmap = jet(n_color);
            end
        end       
        
        function cmap = gat2(n_color)
            if nargin < 1
                n_color = 255;
            end
            
            N = n_color;
            
            L = ones(n_color,1)*100;
            a = ones(n_color,1)*0;
            b = ones(n_color,1)*0;
            
            % RED     100  128  128
            % VIOLET  100  128 -128
            % GREEN     x -128  128
            % BLUE      x -128 -128
            
            n_val = floor(N/5);
            Lab1 = [96 -17 11];
            Lab2 = [86 11 80];
            step = 1/(n_val);
            L(1:1+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','linear');
            a(1:1+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
            b(1:1+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
            s = 1+n_val;
            
            n_val = floor(N/5);
            Lab1 = Lab2;
            Lab2 = [72 -29 31];
            step = 1/(n_val+1);
            L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (step:step:1)','phcip');
            a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (step:step:1)','linear');
            b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (step:step:1)','linear');
            s = s+n_val;
            
            n_val = floor(N/5);
            Lab1 = Lab2;
            Lab2 = [58 -33 -21];
            step = 1/(n_val+1);
            L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (step:step:1)','phcip');
            a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (step:step:1)','linear');
            b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (step:step:1)','linear');
            s = s+n_val;
            
            n_val = floor(N/5);
            Lab1 = Lab2;
            Lab2 = [45 2 -60];
            step = 1/(n_val+1);
            L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (step:step:1)','phcip');
            a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (step:step:1)','linear');
            b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (step:step:1)','linear');
            s = s+n_val;
            
            Lab1 = Lab2;
            Lab2 = [10 27 -80];
            step = 1/(n_color-s+1);
            L(s:end) = interp1([0 1]', [Lab1(1) Lab2(1)], (step:step:1)','linear');
            a(s:end) = interp1([0 1]', [Lab1(2) Lab2(2)], (step:step:1)','linear');
            b(s:end) = interp1([0 1]', [Lab1(3) Lab2(3)], (step:step:1)','linear');
            
            %L = [[0:100/(nColors/2-1):100]' ; flipud([0:100/(nColors/2-1):100]')];
            %L = flipud([25:(100-25)/(nColors-1):100]');
            cmap = flipud(Colormap.lab2RGB(L, a, b )./255);
        end
    end
    
