                ylabel([map_set{m} ' BW'], 'FontWeight', 'Bold', 'Rotation',0, 'VerticalAlignment', 'middle', 'HorizontalAlignment', 'right', 'interpreter', 'none');
            end
            
            % If it is not docked maximize the figure
            if strcmp(fh.WindowStyle, 'normal')
                maximizeFig(fh);
            end
        end
